 Purchase','Nikola, thank you for your recent purchase. We hope you enjoy your new product!','2025-01-29 14:50:57'),(16,16,17,'Survey Request','Iva, we value your opinion. Please take a moment to complete our survey.','2025-01-29 14:50:57'),(17,17,18,'Offer Expiring Soon','Toni, just a reminder that your special offer will expire in 24 hours. Don\'t miss out!','2025-01-29 14:50:57'),(18,18,19,'New Message from Support','Marta, our support team has sent you a new message regarding your request. Please check your inbox.','2025-01-29 14:50:57'),(19,19,20,'Subscription Expiration','Stipe, your subscription is about to expire. Please renew to continue enjoying our services.','2025-01-29 14:50:57'),(20,20,21,'Thank You for Joining','Lea, thank you for joining our platform. We are excited to have you with us!','2025-01-29 14:50:57');
